import BookGrid from "../components/BookGrid";

export default function SearchResults({ results }) {
  return (
    <div className="text-right space-y-4">
      <h1 className="text-3xl font-bold text-gray-800">نتائج البحث</h1>

      {results.length > 0 ? (
        <BookGrid books={results} />
      ) : (
        <p className="text-gray-600">لم يتم العثور على كتب تطابق بحثك.</p>
      )}
    </div>
  );
}
